angular.module("templates",[]).run(["$templateCache",function(n){n.put("/partials/directives/pagination.html",'<div id="pagination" ng-if="pages.length >= 2">\n  <ul class="pagination">\n    <li ng-if="currentPage > 1">\n      <a class="arrow" ng-click="selectPage(1)">\n        <span class="glyphicon glyphicon-chevron-left"></span>\n        <span class="glyphicon glyphicon-chevron-left"></span>\n      </a>\n    </li>\n    <li ng-repeat="page in pages" ng-class="{active: page==currentPage}">\n      <a ng-click="selectPage(page)">{{page}}</a>\n    </li>\n    <li ng-if="currentPage < numPages">\n      <a class="arrow" ng-click="selectPage(numPages)">\n        <span class="glyphicon glyphicon-chevron-right"></span>\n        <span class="glyphicon glyphicon-chevron-right"></span>\n      </a>\n    </li>\n  </ul>\n</div>\n'),n.put("/partials/views/dashboard/index.html",'<div ui-view="modal" autoscroll="false"></div>\n\n<div class="container-fluid">\n  <section st-table="rowCollection" st-safe-src="safe_data">\n    <div class="row">\n      <div class="col-md-9 col-centered">\n        <div class="pull-left">\n          <a ui-sref="App.dashboard.modal({type: \'create\'})" class="btn btn-success">Novo Carro</a>\n          <a ng-click="delete()" ng-if="selected_cars.length > 0" class="btn btn-danger">Excluir {{selected_cars.length}} carros selecionados</a>\n        </div>\n\n        <div id="search" class="pull-right col-md-3">\n          <div class="form-group">\n            <div class="input-group">\n              <input st-search class="form-control" placeholder="Pesquisar" type="text"/>\n              <div class="input-group-addon">\n                <span class="glyphicon glyphicon-search"></span>\n              </div>\n            </div>\n          </div>\n        </div>\n      </div>\n    </div>\n\n    <div class="row">\n      <div class="col-md-9 col-centered">\n        <table class="table table-hover">\n          <thead>\n            <tr>\n              <th>\n                <div class="checkbox">\n                  <input type="checkbox" ng-model="selected_all" ng-click="check_all()" id="select_all">\n                  <label for="select_all"></label>\n                </div>\n              </th>\n              <th st-sort="placa">Placa</th>\n              <th st-sort="modelo">Modelo</th>\n              <th st-sort="marca">Marca</th>\n              <th st-sort="imagem">Foto</th>\n              <th st-sort="combustivel">Combustível</th>\n              <th st-sort="valor">Valor</th>\n            </tr>\n          </thead>\n          <tbody>\n            <tr class="cursor-pointer" ng-click="open_car(car)" ng-repeat="car in rowCollection">\n              <td>\n                <div class="checkbox">\n                  <input type="checkbox" ng-model="car.is_selected" ng-change="handle_selected_cars(car, true)" ng-click="$event.stopPropagation();" id="checkbox_{{row.id}}">\n                  <label for="checkbox_{{row.id}}"></label>\n                </div>\n              </td>\n              <td>{{car.placa}}</td>\n              <td>{{car.modelo}}</td>\n              <td>{{car.marca}}</td>\n              <td>\n                <a class="cursor-pointer" ng-if="car.imagem" ng-click="open_image(car.imagem); $event.stopPropagation();">Imagem\n                </a>\n                <span ng-if="!car.imagem">Sem imagem</span>\n              </td>\n              <td>{{car.combustivel}}</td>\n              <td>R${{car.valor | setDecimal: 2}}</td>\n            </tr>\n          </tbody>\n        </table>\n      </div>\n    </div>\n\n    <div class="row">\n      <div class="col-md-9 col-centered text-center">\n        <div st-template="/partials/directives/pagination.html" st-pagination="" st-items-by-page="5" st-displayed-pages="5"></div>\n      </div>\n    </div>\n  </section>\n</div>'),n.put("/partials/views/dashboard/modal.html",'<div class="container-fluid">\n  <div class="row">\n    <div class="col-md-12">\n      <form name="carForm" ng-submit="submit()">\n        <header>\n          <h2 ng-if="type == \'create\'">Novo carro</h2>\n          <h2 ng-if="type == \'edit\'">Editar carro: {{car.id}}</h2>\n        </header>\n        <div class="form-group">\n          <label for="placa" class="col-md-16 control-label">Placa*</label>\n          <div>\n            <input id="placa" ng-model="car.placa" name="placa" ng-pattern="/^[A-Z]{3}-\\d{4}$/i" type="text" required="" class="form-control"/>\n            <span class="help-block">Ex: XXX-9999</span>\n          </div>\n        </div>\n        <div class="form-group">\n          <label for="imagem" class="col-md-16 control-label">Imagem ( Link externo )</label>\n          <div>\n            <input id="imagem" ng-model="car.imagem" name="imagem" type="text" ng-pattern="/^https?://(?:[a-z0-9\\-]+\\.)+[a-z0-9]{2,6}(?:/[^/#?]+)+\\.(?:jpg|gif|png)$/i" class="form-control"/>\n          </div>\n        </div>\n        <div class="form-group">\n          <label for="marca" class="col-md-16 control-label">Marca*</label>\n          <div>\n            <input id="marca" ng-model="car.marca" name="marca" type="text" required="" class="form-control"/>\n          </div>\n        </div>\n        <div class="form-group">\n          <label for="modelo" class="col-md-16 control-label">Modelo*</label>\n          <div>\n            <input id="modelo" ng-model="car.modelo" name="modelo" type="text" required="" class="form-control"/>\n          </div>\n        </div>\n        <div class="form-group">\n          <label for="combustivel" class="col-md-16 control-label">Combustível</label>\n          <div>\n            <select id="combustivel" ng-model="car.combustivel" class="form-control">\n              <option value="Gasolina">\n                Gasolina\n              </option>\n              <option value="Álcool">\n                Álcool\n              </option>\n              <option value="Flex">\n                Flex\n              </option>\n            </select>\n          </div>\n        </div>\n        <div class="form-group">\n          <label for="valor" class="col-md-16 control-label">Valor</label>\n          <div>\n            <input id="valor" ng-model="car.valor" name="valor" type="text" ui-money-mask class="form-control"/>\n          </div>\n        </div>\n        <div class="form-group">\n          <div class="col-md-12 text-center">\n            <button type="submit" ng-disabled="carForm.$invalid" class="btn btn-success">Salvar</button>\n          </div>\n        </div>\n      </form>\n    </div>\n  </div>\n</div>')}]);